import React from "react";

const List = () => {
  return (
    <div className="container">
      <h2 className="text-centre">Show all data</h2>
      <div className="row">
        <div className="column">
          <div class="card">
            <div class="card-body">
              <h5 class="card-title">Task</h5>
              <h6 class="card-subtitle mb-2 text-body-secondary">
                Description
              </h6>
              
              <h3 class="card-deadline">
                Deadline
              </h3>
              &nbsp;&nbsp;&nbsp;&nbsp;
              <h3 class="card-status">
                Status
              </h3>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default List;
